// I got my radio Group button from this website:
// https://mui.com/material-ui/react-radio-button/

import "./App";
import Radio from '@mui/material/Radio';
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormControl from '@mui/material/FormControl';
import FormLabel from '@mui/material/FormLabel';
import Checkbox from '@mui/material/Checkbox';

function CategoryButtons2({filterCategory}) {
    return (
        <FormControl>
            <FormLabel>Brand</FormLabel>
            <RadioGroup defaultValue="All">
                <Checkbox value="All" control={<Radio />} label="All" onClick={()=> {filterCategory("All")}} />
                <Checkbox value="a" control={<Radio />} label="a" onClick={()=> {filterCategory("a")}} />
                <Checkbox value="b" control={<Radio />} label="b" onClick={()=> {filterCategory("b")}} />
                <Checkbox value="c" control={<Radio />} label="c" onClick={()=> {filterCategory("c")}} />
            </RadioGroup>
      </FormControl>
    );
}

export default CategoryButtons2;
